  false,\n\t\"url\": null,\n\t\"notes\": \"Gravity for the Re-definition of the American
  Vertical Datum (GRAV-D) is a project initiated by NOAA's National Geodetic Survey
  to collect and monitor gravity data suitable for the re-definition of the vertical
  datum for at least the United States and territories. Airborne gravity data will
  be collected from 2008-2022, processed, and released periodically in geographic
  blocks. Each block is comprised of one or more surveys. The data will be available
  at http://www.ngs.noaa.gov/GRAV-D/data_products.shtml in ASCII text format. Some
  data collection has and will be done in conjunction with partners, such as the US
  Geological Survey, National Geospatial-Intelligence Agency, Bureau of Land Management,
  and the Naval Research Laboratory.\",\n\t\"license_title\": null,\n\t\"extras\":
